import React, { useEffect, useState } from 'react'

const Users = () => {
    const [list, setList] = useState([]);

    useEffect(() => {
        const users = [
            {
                firstName: 'Demo',
                age: 20,
                email: 'demo@gmail.com'
            },
            {
                firstName: 'john',
                age: 22,
                email: 'john@gmail.com'
            },
            {
                firstName: 'doe',
                age: 25,
                email: 'doe@gmail.com'
            }
        ]
        setList(users);
    })
    return (
        <div><h1>users</h1> 
            <div>
                {list.map((ele,i)=>(
                    <div key={i}>
                        <span>{ele.firstName}</span>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Users;
